import { GuitarTab } from '../GuitarTab/GuitarTab';

export function GuitarTabsList({ chord: { positions } }) {
  const onePosition = positions.map((pos) => <GuitarTab position={pos} />);
  return positions.map((pos) => <GuitarTab position={pos} />);
}
